import React, { useState } from 'react';

const arr = [];
function MachineList({ status = arr, count = arr, assets = arr }){
  const [open, setOpen] = useState(false);

  function handleClick() {
    setOpen(true);
  }

  return (
    <li>
      <h3 onClick={handleClick}>
        {status}
        <span>{count}</span>
      </h3>
    </li>
  );
}

export default MachineList;
